var arSA={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"السماح","Allow in your wallet":"السماح في محفظتك","Allow {symbol} first":["اسمح بـ ",["symbol"]," أولاً"],"Allowance pending":"البدل معلق","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"حدث خطأ أثناء محاولة تنفيذ هذا التبادل. قد تحتاج إلى زيادة تحملك للانزلاق. إذا لم يفلح ذلك ، فقد يكون هناك عدم توافق مع الرمز الذي تتداوله. ملاحظة: رسوم النقل وإعادة الرموز المميزة غير متوافقة مع Uniswap V3.","Approval pending":"في انتظار الموافقة","Approve":"الموافقة","Approve Permit2":"Approve Permit2","Approve in your wallet":"الموافقة في محفظتك","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["الموافقة على ",["symbol"]," أولاً"],"Auto":"تلقائي","Auto Router":"جهاز التوجيه التلقائي","Auto Router API":"Auto Router API","Balance:":"الرصيد:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"إغلاق","Confirm in your wallet":"قم بالتأكيد في محفظتك","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"توصيل بمحفظة","Connecting…":"ربط…","Continue":"Continue","Convert {0} to {1}":["قم بالتحويل من ",["0"]," إلى ",["1"]],"Convert {0} to {1} with no 