your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"حاول زيادة تحملك للانزلاق.<0/>ملحوظة: الرسوم المفروضة على رموز النقل وإعادة التسمية غير متوافقة مع Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"خطأ غير متوقع. لا يمكن تقدير الغاز للمبادلة.","Unexpected issue with estimating the gas. Please try again.":"مشكلة غير متوقعة في تقدير الغاز. حاول مرة اخرى.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"عرض على Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"تحذير","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"ستعود معاملتك إذا كانت معلقة لفترة أطول من هذه الفترة الزمنية.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"سيتم عودة معاملتك إذا تغير السعر بشكل غير مؤات بأكثر من هذه النسبة.","minutes":"دقائق","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," رسوم"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

